import TodoList from "./TodoList";
import {useState} from 'react';

function App() {
  const [todos, setTodos] = useState([])
  return (
    <>
      <TodoList todos={todos}/>
      <input type="text"></input>
      <button>Add to do</button>
      <button>Clear Complete</button>
      <div>0 left to do</div>
    </>
  )
}

export default App;
